import "./SalaryCards.css";
import Card from '../Card/Card'

const SalaryCards = ({ data, filteredData }) => {

  const salaryCards = data.map(post => {
    const newSalary = post.salary.toLocaleString('en-US')
    if (!filteredData.length) {
      return (
        <Card
        key={post.id}
        name={post.username}
        age={post.age}
        gender={post.gender}
        gradYear={post.gradYear}
        company={post.company}
        yearsExp={post.yearsOfExperience}
        degree={post.degree}
        state={post.state}
        salary={newSalary}
        negotiate={post.negotiation}
        positionTitle={post.positionTitle}
        typeOfEmp={post.typeOfEmployment}
        locationOfEmp={post.locationOfEmployment}
        jobHuntDuration={post.jobHuntDuration}
        />
      );
    } else {
      return (
        <Card
        key={filteredData.id}
        name={filteredData.username}
        age={filteredData.age}
        gender={filteredData.gender}
        gradYear={filteredData.gradYear}
        company={filteredData.company}
        yearsExp={filteredData.yearsOfExperience}
        degree={filteredData.degree}
        state={filteredData.state}
        salary={newSalary}
        negotiate={filteredData.negotiation}
        positionTitle={filteredData.positionTitle}
        typeOfEmp={filteredData.typeOfEmployment}
        locationOfEmp={filteredData.locationOfEmployment}
        jobHuntDuration={filteredData.jobHuntDuration}
        />
      );
    }

  return (
    <section className="salary-cards-container">
     {salaryCards}
    </section>
  );
})
}


export default SalaryCards;
